import React from 'react';
import Button from '@material-ui/core/Button';
import '../styles/components/Navbar.css'

function Navbar () {


    return (
        <div className='Navbar'>
            <div className="navButtons-wrapper">
                <ul>
                    <li><Button color="primary">Today</Button></li>
                    <li><Button color="primary">Tomorrow</Button></li>
                    <li><Button color="primary">Week</Button></li>
                </ul>
            </div>
            <div className="navSearch-wrapper">

            </div>

        </div>
    );
};

export default Navbar;
